import React, { useState, useEffect } from "react";
import Gallery from "react-photo-gallery";
import photo from '../assets/photo.jpg'

const Gallery1 = () => {
  const photos = [

      {
        src: photo,
        width: 4,
        height: 3
      },
      {
        src: photo,
        width: 1,
        height: 1
      }

  ]
  return (
  <Gallery photos={photos} />
  )
  }

export default Gallery1;
